# Remove rows where the subject and parametric object are similar using Jaro-Winkler similarity
mask = parametric_knowledge_dataset.apply(
    lambda row: JaroWinkler.normalized_similarity(str(row['statement_subject']), str(row['parametric_object'])) < string_similarity_ratio,
    axis=1
)
return parametric_knowledge_dataset[mask].reset_index(drop=True)
